description:
Nuclear Score - When a lunatic dictator seizes power of a distant and militant nuclear nation, Ariella Ferrera, Johnny's sexy MILF neighbor, says she'll do anything for a spot in Johnny's bunker. Dicky's Dorky's Revenge - Charlie is the salacious head mistress of an all-girls school. Along comes Xander, a feisty little bugger who has found a way to spy on Charlie's students showering. Little does he know he is in for the surprise of a lifetime.


Julia Ann, Francesca Le, Brandi Love, Inari Vachs, Ariella Ferrera, Charlee Chase, Chloe Reece Ryder, Lena Franks


